local function GetColoredUnitClassAndName(unit)
    -- Get the unit's class and name
    local unitName = UnitName(unit)
    local _, class = UnitClass(unit)

    if not unitName or not class then
        return nil
    end

    local classColor = RAID_CLASS_COLORS[class]
    if classColor then
        local colorCode = string.format("|cff%02x%02x%02x", classColor.r * 255, classColor.g * 255, classColor.b * 255)
        return colorCode .. unitName .. "|r"
    else
        return unitName
    end
end

-- functions for interrupt order
local partyMembers = {}
local partyCooldowns = {}
local reflectCooldowns = {}

local function isSpellReflectable(caster, target, spellId)
    local class, _, _ = UnitClass(target)
    if (class == "Warrior") then
        if (reflectCooldowns[UnitGUID(target)] ~= nil and reflectCooldowns[UnitGUID(target)] >= GetTime()) then
            return false
        end

        return reflectionSpells[spellId] ~= nil;
    end
    return false
end

-- Get the unitid of the group leader
local function GetGroupLeaderUnitID()
    if (not IsInGroup()) then
        return nil
    end
    if UnitIsGroupLeader("player") then
        return "player"
    end
    for i = 1, GetNumGroupMembers() do
        if UnitGUID("party" .. i) ~= nil and UnitIsGroupLeader("party" .. i) then
            return "party" .. i
        end
    end
    return nil
end

-- class prioirty for kicks druid > warr > rogue > monk > hunter
local function GetInterruptOrder()
    local order = {
        [1] = "Druid",
        [2] = "Warrior",
        [3] = "Rogue",
        [4] = "Monk",
        [5] = "Hunter",
        [6] = "Death Knight",
        [7] = "Demon Hunter",
        [8] = "Shaman",
        [9] = "Paladin",
        [10] = "Mage",
        [11] = "Warlock",
        [12] = "Priest",
    }
    return order
end

local function IsPartyCooldownReadyBefore(unitID, endTime)
    if (partyCooldowns[unitID] == nil) then
        return true
    end

    -- check if the party cooldown is ready within the endtime
    if partyCooldowns[unitID] - endTime <= 0 then
        return true
    end

    return false
end

-- Get the unitid of the player with the highest priority
local function GetNextKickerUnitID(castEndTime)
    local order = GetInterruptOrder()
    
    for i = 1, #order do
        if (UnitClass("player") == order[i] and IsPartyCooldownReadyBefore("player", castEndTime)) then
            return "player", i
        end

        for j = 1, GetNumGroupMembers() do
            local unitID = "party" .. j
            if UnitClass(unitID) == order[i] and IsPartyCooldownReadyBefore(unitID, castEndTime) then
                return unitID, i
            end
        end
    end
    return nil
end

local function GetUnitIDWithPersonWhoWillHaveSoonestKick ()
    local smallestUnit = nil
    local smallestTime = 1000000
    
    for unit in pairs(partyCooldowns) do
        if partyCooldowns[unit] < smallestTime then
            smallestTime = partyCooldowns[unit]
            smallestUnit = unit
        end
    end

    return smallestUnit, smallestTime;
end

