                nameplate.interruptFrame:Show();
                -- if (nameplate.prevStrata == nil) then
                --     nameplate.prevStrata = nameplate:GetFrameStrata()
                --     nameplate:SetFrameStrata("TOOLTIP")
                -- end
                if (nameplate.prevFrameLevel == nil) then
                    nameplate.prevFrameLevel = nameplate:GetFrameLevel()
                    nameplate:SetFrameLevel(100)
                end
                local kicker, order = GetNextKickerUnitID(endTime / 1000)
                if (kicker ~= nil) then
                    if (warrHasReflectAuraUp == true) then
                        nameplate.interruptFrame.numberBox.text2:SetText(GetColoredUnitClassAndName(kicker) .. "|cffFFFFFF|R [REFLECT!]");
                    else
                        nameplate.interruptFrame.numberBox.text2:SetText(GetColoredUnitClassAndName(kicker));
                    end
                    nameplate.interruptFrame.numberBox.text:SetText(tostring(order));

                    if (UnitGUID(kicker) == UnitGUID("player")) then
                        nameplate.interruptFrame.numberBox.bg:SetColorTexture(0, 1, 0, 0.5)

                        if (nameplate.kickAnnTimer == nil or GetTime() > nameplate.kickAnnTimer and not canReflectIt) then
                            nameplate.kickAnnTimer = GetTime() + 5;
                            C_VoiceChat.SpeakText(1, "Kick", Enum.VoiceTtsDestination.LocalPlayback, 0, 100)
                        end
                    else
                        nameplate.interruptFrame.numberBox.bg:SetColorTexture(1, 0, 0, 0.5)
                    end
                else
                    local smallestKickUnitID, unitIdEndTime = GetUnitIDWithPersonWhoWillHaveSoonestKick();
                    if (smallestKickUnitID ~= nil and endTime < unitIdEndTime) then
                        nameplate.interruptFrame.numberBox.text2:SetText(GetColoredUnitClassAndName(smallestKickUnitID) .. " " .. math.floor(unitIdEndTime - GetTime()));
                    elseif (warrHasReflectAuraUp == true) then
                        nameplate.interruptFrame.numberBox.text2:SetText("REFLECT");
                    else
                        nameplate.interruptFrame.numberBox.text2:SetText("DEFENSIVE?");
                    end

                    if (smallestKickUnitID ~= nil and UnitGUID(smallestKickUnitID) == UnitGUID("player")) then
                        nameplate.interruptFrame.numberBox.bg:SetColorTexture(0, 1, 0, 0.5)
                    else
                        nameplate.interruptFrame.numberBox.bg:SetColorTexture(1, 0, 0, 0.5)
                    end
                end
                nameplate.interruptFrame.numberBox:Show()
            else
                nameplate.interruptFrame.numberBox.text2:SetText("")
                nameplate.interruptFrame.numberBox:Hide()
            end
        else
            -- if nameplate.prevStrata ~= nil then
            --     nameplate:SetFrameStrata(nameplate.prevStrata)
            --     nameplate.prevStrata = nil
            -- end

            if nameplate.prevFrameLevel ~= nil then
                nameplate:SetFrameLevel(nameplate.prevFrameLevel)
                nameplate.prevFrameLevel = nil
            end

            if nameplate.interruptFrame.numberBox:IsShown() then
                nameplate.interruptFrame.numberBox.text2:SetText("")
                nameplate.interruptFrame.numberBox:Hide()
            end
        end
    end
end

local function UpdateCooldowns()
    for unit in pairs(partyCooldowns) do
        local expires = partyCooldowns[unit]
        if expires > 0 and expires - GetTime() <= 0 then
            partyCooldowns[unit] = null
        end
    end
    for unitID, nameplate in pairs(nameplateFrames) do
        UpdateInterruptInfo(unitID)
    end
end

local function PartyHandler(self, event, ...)
    if event == "COMBAT_LOG_EVENT_UNFILTERED" then
        local _, subevent = CombatLogGetCurrentEventInfo()
        if (subevent == "SPELL_CAST_SUCCESS") then
            local sourceGUID = select(4, CombatLogGetCurrentEventInfo())
            local spellID = select(12, CombatLogGetCurrentEventInfo())
            if interrupts[spellID] then
                local unitID = GetUnitIDInPartyOrSelfByGuid(sourceGUID)
                if unitID then
                    local name = UnitName(unitID);
                    local cooldown = GetSpellBaseCooldown(spellID) / 1000
                    partyCooldowns[unitID] = GetTime() + cooldown
                end
            elseif spellID == 23920 then
                local unitID = GetUnitIDInPartyOrSelfByGuid(sourceGUID)
                if unitID then
                    local name = UnitName(unitID);
                    local cooldown = 25
                    reflectCooldowns[UnitGUID(unitID)] = GetTime() + cooldown
                end
            end
        end
    elseif event == "GROUP_ROSTER_UPDATE" then
        -- Clean up partyCooldowns table for missing members
        for unit in pairs(partyCooldowns) do
            if not UnitInParty(unit) then
                partyCooldowns[unit] = nil
            end
        end
        for unit in pairs(reflectCooldowns) do
            if not GetUnitIDInPartyOrSelfByGuid(unit) then
                reflectCooldowns[unit] = nil
            end
        end
        for unit in IterateSelfAndPartyMembers() do
            if (UnitExists(unit)) then
                partyMembers[unit] = {}
            else
                partyMembers[unit] = nil
            end
        end
    elseif event == "NAME_PLATE_UNIT_ADDED" then
            local unitID = ...
            local nameplate = C_NamePlate.GetNamePlateForUnit(unitID)
            if nameplate then
                CreateInterruptAnchor(nameplate)
                nameplateFrames[unitID] = {};
                nameplateFrames[unitID].nameplate = nameplate
            end
    elseif event == "NAME_PLATE_UNIT_REMOVED" then
        local unitID = ...
        if nameplateFrames[unitID] and nameplateFrames[unitID].nameplate.interruptFrame then
            nameplateFrames[unitID].nameplate.interruptFrame:Hide()
            nameplateFrames[unitID] = nil
        end
    elseif (event == "UNIT_AURA") then
        local unit, info = ...
        local guid = UnitGUID(unit)
        if info.addedAuras then
            for _, v in pairs(info.addedAuras) do
                if (v.spellId == 23920) then
                    if (partyMembers[guid] == nil) then
                        partyMembers[guid] = {}
                    end
                    partyMembers[guid].auraInstanceId = v.auraInstanceID
                    partyMembers[guid].hasReflect = true
                    partyMembers[guid].reflectTime = GetTime()
                    partyMembers[guid].reflectEndTime = GetTime() + 5
                end
            end
        end

        if info.removedAuraInstanceIDs and partyMembers[guid]  then
            for _, v in pairs(info.removedAuraInstanceIDs) do
                if (partyMembers[guid].auraInstanceId == v) then
                    partyMembers[guid].hasReflect = false
                    partyMembers[guid].reflectTime = nil
                    partyMembers[guid].reflectEndTime = nil
                end
            end
        end
    elseif (event == "CHAT_MSG_ADDON") then
        local prefix, message, channel, sender = ...
        if (prefix == "SVTG1") then
            local msgType, unitId = strsplit("|", message)
            if (msgType == "KICKMOB") then
                unitIdToTrack = unitId
                print ("new interrupt order found send by " .. sender);
            end
        end
    end
end

local frame = CreateFrame("Frame")
frame:RegisterEvent("NAME_PLATE_UNIT_ADDED")
frame:RegisterEvent("NAME_PLATE_UNIT_REMOVED")
frame:RegisterEvent("COMBAT_LOG_EVENT_UNFILTERED")
frame:RegisterEvent("GROUP_ROSTER_UPDATE")
frame:RegisterEvent("UNIT_AURA")
frame:RegisterEvent("CHAT_MSG_ADDON");
frame:SetScript("OnUpdate", UpdateCooldowns)
frame:SetScript("OnEvent", PartyHandler)

local function IteratePartyMembers()
    local i = 0
    return function()
        i = i + 1
        if i <= GetNumGroupMembers() then
            return "party" .. i
        end
    end
end

-- Slash command handler function
local function MarkKickRotationHandler(msg, editBox)
    -- Logic for handling the command
    local unitId = nil;
    if msg == "focus" then
        unitId = UnitGUID("focus")
    elseif msg == "target" then
        unitId = UnitGUID("target")
    else
        unitId = UnitGUID("focus")
    end

    if unitId == nil then
        unitId = UnitGUID("target")
    end

    if unitId == nil then
        print ("No target or focus")
        return
    end

    local addonMsg = "KICKMOB|" .. unitId .. "|";

    for player in IteratePartyMembers() do
        if (player ~= nil and UnitExists(player)) then
            C_ChatInfo.SendAddonMessage("SVTG1", addonMsg, "WHISPER", UnitName(player));
        end
    end

    unitIdToTrack = unitId;
    print ("Tracking " .. unitId);
end

