SLASH_MARKKICKROTATION1 = "/MARKKICKROTATION" -- Main slash command
SLASH_MARKKICKROTATION2 = "/mkr"             -- Optional shorter alias

SlashCmdList["MARKKICKROTATION"] = MarkKickRotationHandler

